import './App.css';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'

import Start from './components/Start'

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/">
            <Start />
          </Route>

        </Switch>
      </Router>
    </div>
  );
}

export default App;
